"""The following code runs in O(N) time.
    It can be said that if the cummulative sum repeats again then the number of 0 and 1 between the previous
    and the new cummulative sum are equal and the length of array till then can be calculated using
    [current cummlative position] - [previous cummulative position]."""

def findMaxLength(nums):
    result = 0
    dictarray = dict()
    dictarray[0] = -1
    total = 0
    for i in range(len(nums)):
        if nums[i] == 0:
            nums[i] = -1

    for i in range(len(nums)):
        total += nums[i]
        if total not in dictarray:
            dictarray[total] = i
        else:
            result = max(result, i-dictarray[total])

    print(result)



